$(function(){$(window).on("load scroll",function(){if($(window).scrollTop()>740){$(".navbar").addClass("fixed")}else{$(".navbar").removeClass("fixed")}});$("a").each(function(){var a=this;if(a.origin!==location.origin){$(a).attr("target","_blank")}});$("a[href^=#]").click(function(){var scrollHref=$(this).attr("href");var scrollPosition=$(scrollHref).offset().top;$("html,body").animate({scrollTop:scrollPosition},"700");return false})});